import React, {Component} from 'react';
import './App.css';
import Home from '../Home/Home';
import CityData from '../CityData/CityData';


class App extends Component {


  render() {
    return (
      <div className="App">
        <Switch>
          <Route exact path="/">
              <Intro />
          </Route>
          <Route exact path="/citydata/:id">
              <CityData />
          </Route>
        </Switch>
      </div>
    );
  }
}

export default App;
